Rules.InvariantScript:
Set(
    varPublishButtonDisplayMode,
    DisplayMode.Disabled
);

//Collect affected Records
ClearCollect(
    colforpatching,
    Filter(
        colFilteredBookings,
        DateValue(Date) > (varSelectedWeek - Weekday(varSelectedWeek)) && DateValue(Date) <= ((varSelectedWeek - Weekday(varSelectedWeek)) + 7)
    )
);
// store the start time
Set(
    varStartTime_Patch,
    Now()
);

//Update Collection
If(
    Self.Text = "Publish",
    UpdateIf(
        colforpatching,
        'Status Reason' = 'Status Reason (shiftplanner_shiftbookings)'.Unpublished,
        {'Status Reason': 'Status Reason (shiftplanner_shiftbookings)'.Published}
    );
    ,
    UpdateIf(
        colforpatching,
        'Status Reason' = 'Status Reason (shiftplanner_shiftbookings)'.Published,
        {'Status Reason': 'Status Reason (shiftplanner_shiftbookings)'.Unpublished}
    );
    
);
//Patch Dataverse
Patch(
    shiftplanner_shiftbookings,
    ShowColumns(
        colforpatching,
        shiftplanner_shiftbooking,
        'Status Reason'
    )
);

//Run both Week Status Email Notification and Week Status Calendar Invite flow with parameters: First Day of Selected Week, Last Day of Selected Week, Zone, Action (Publish/Unpublish)


WeekStatusEmailNotification.Run(Text(varSelectedWeek - Weekday(varSelectedWeek) + 1, "yyyy-mm-dd"), Text((varSelectedWeek - Weekday(varSelectedWeek)) + 7, "yyyy-mm-dd"), varSelectedZone.shiftplanner_zone, Self.Text);
WeekStatusCalendarInvite.Run(Text(varSelectedWeek - Weekday(varSelectedWeek) + 1, "yyyy-mm-dd"), Text((varSelectedWeek - Weekday(varSelectedWeek)) + 7, "yyyy-mm-dd"), varSelectedZone.shiftplanner_zone, Self.Text);


// calculate the difference between start time and end time
Set(
    varDuration_Patch,
    DateDiff(
        varStartTime_Patch,
        Now(),
        TimeUnit.Milliseconds
    )
);
ClearCollect(
    colFilteredBookings,
    Filter(
        shiftplanner_shiftbookings,
        Zone.Name = varSelectedZone.Name && Status = 'Status (shiftplanner_shiftbookings)'.Active
    )
);
//Clear(colforpatching);
Navigate(compConfirmation.BackTarget);
With(
    {
        PublishNotification: "Selected week has been published.",
        UnpublishNotification: "Selected week has been unpublished."
    },
    If(
        Self.Text = "Publish",
        Notify(
            PublishNotification,
            NotificationType.Success,
            varTheme.toastTimeout
        ),
        Notify(
            UnpublishNotification,
            NotificationType.Success,
            varTheme.toastTimeout
        )
    )
);

Set(
    varPublishButtonDisplayMode,
    DisplayMode.Edit
);
